import React from "react";

const Card = (props) => {
    return (
        <div className="card" data-logo={props.logo}>
            <img src="images/ls.png" className="card-back" alt="card placeholder"/>
            <img src={'images/' + props.logo + '.png'} className="card-front" alt="card front"/>
        </div>
    )
}


export default Card;
